import React from "react";

export default function ExpenseList({ list }) {
  if (list.length === 0) return <p>Поки що немає витрат</p>;

  return (
    <ul>
      {list.map((item) => (
        <li key={item.id}>
          <strong>{item.expense}</strong> - {item.price} грн ({item.category})
        </li>
      ))}
    </ul>
  );
}
